(10081, 'JA News Featured', 'module', 'mod_janews_featured', '', 0, 1, 0, 0, '{"legacy":false,"name":"JA News Featured","type":"module","creationDate":"September 2011","author":"JoomlArt.com","copyright":"J.O.O.M Solutions Co., Ltd.","authorEmail":"webmaster@joomlart.com","authorUrl":"www.joomlart.com","version":"1.1.0","description":"\\n\\t\\t\\n\\t\\t\\t<h1>Introduce<\\/h1>\\n\\t\\t\\t<div style=''font-weight:normal''><span style=''color: #008000;''>JA News Featured provides you a lightweight but powerful news headline style of your most recent content items.<\\/strong><\\/span><p><span style=''color: #ff6600;''><strong>Features:<\\/strong><\\/span><\\/p><img border=''0'' alt=''JA News Featured'' src=''http:\\/\\/asset.joomlart.com\\/images\\/stories\\/extensions\\/joomla\\/jaec_newsfp_mod.png?javer=1109280907'' style=''float: left''>Rearrange frontpage contents (article choose to display on frontpage) of Joomla into Headline layouts like news portal.<p><strong><span style=''color: #ff0000;''>Important Instructions:<\\/span><\\/strong><\\/p>For Userguide, please visit <a href=''http:\\/\\/www.joomlart.com\\/forums\\/showthread.php?t=11946'' target=''_blank''>Here<\\/a><p><strong><span style=''color: #ff0000;''>Usage Instructions:<\\/span><br \\/><\\/strong><\\/p>- Support 8 template layout and K2 component <br \\/>- Animation content display<br \\/>- Configuration easy<p><strong><span style=''color: #ff0000;''>Upgrade Methods:<\\/span><br \\/><\\/strong><\\/p><ol><li>Standard joomla uninstall \\/ reinstall method. Module supports upgrade method. <\\/li><li>You can install new version directly over this version. Uninstallation is not required. <\\/li><li>Backup any customized file before upgrading, your settings would be saved though.<\\/li><\\/ol><p><span style=''color: #008000;''><strong>Links:<\\/strong><\\/span><\\/p><ul><li><a target=''_blank'' href=''http:\\/\\/update.joomlart.com\\/#products.list\\/module_16\\/JA%20News%20Featured%20module%20for%20Joomla%201.7\\/''>Updates &amp; Versions<\\/a><\\/li><\\/ul><p>Copyright 2004 - 2011 <a href=''http:\\/\\/www.joomlart.com\\/'' title=''Visit Joomlart.com!''>JoomlArt.com<\\/a>.<\\/p>\\n\\t\\t\\t<\\/div>\\n\\t\\t\\n\\t","group":""}', '{"moduleclass_sfx":"","settingcontent":"","source":"JANewsHelper","catsid":"","k2catsid":"","getChildren":"1","featured":"hide","ordering":"ordering","sort_order":"DESC","settingprofile":"","profile":"default","JPlugins":"1","K2Plugins":"1","cache":"1","cache_time":"900"}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
(10082, 'System - JA Tabs', 'plugin', 'jatabs', 'system', 0, 1, 1, 0, '{"legacy":true,"name":"System - JA Tabs","type":"plugin","creationDate":"December 2011","author":"JoomlArt.com","copyright":"Copyright (C), J.O.O.M Solutions Co., Ltd. All Rights\\n\\t\\tReserved.","authorEmail":"webmaster@joomlart.com","authorUrl":"www.joomlart.com","version":"1.1.7","description":"\\n\\t\\t\\n\\t\\t\\t<span style=\\"color: #008000;\\"><strong>JA Tabs Plugin<\\/strong><\\/span>\\n\\t\\t\\t<p><span style=\\"color: #ff6600;\\"><strong>Introduce:<\\/strong><\\/span><\\/p>\\n\\t\\t\\t<div style=\\"font-weight: normal\\">\\n\\t\\t\\t<p><strong><img src=''..\\/plugins\\/system\\/jatabs\\/jatabs\\/tabs.png'' \\/>\\n\\t\\t\\t<span style=''margin-top:10px;''>JA Tabs plugin is a plugin help you to create tabs in any positions in the Joomla!<\\/span><\\/strong><\\/p>\\n\\t\\t\\t<p><span style=\\"color: #ff6600;\\"><strong>Features:<\\/strong><\\/span><\\/p>\\n\\t\\t\\t<ol class=\\"checklist\\" style=''clear:both''>\\n\\t\\t\\t<li>Support multi types of content: Module Position, Module name, HTML Content, Articles Ids, Category Id<\\/li>\\n\\t\\t\\t<li>Configurable animations: Left\\/right, up\\/down, fading...<\\/li>\\n\\t\\t\\t<li>Multi themes support<\\/li>\\n\\t\\t\\t<li>Multi Languages<\\/li>\\n\\t\\t\\t<li>Full of configuration<\\/li>\\n\\t\\t\\t<\\/ol>\\n\\t\\t\\t<\\/div>\\n\\t\\t\\t<p><strong><span style=\\"color: #ff0000;\\">Usage Instructions:<\\/span><br \\/><\\/strong><\\/p>\\n\\t\\t\\t<p><span style=\\"color: #ff6600;\\"><strong>Parameter Options General:<\\/strong><\\/span><\\/p>\\n\\t\\t\\t<h3 style=\\"color: blue\\">All parameter options for the Ja Tabs Plugin.<\\/h3>\\n\\t\\t\\t<div  style=\\"font-weight: normal\\">\\n\\t\\t\\t<ol>\\n\\t\\t\\t<li><strong>type:<\\/strong> <br \\/> (modules, module, content, articles). The Ja Tabs typing.<\\/li>\\n\\t\\t\\t<li><strong>position:<\\/strong> <br \\/> (top, left, right, bottom). Positon of the tabs. Value default is top.<\\/li>\\n\\t\\t\\t<li><strong>style:<\\/strong><br \\/> The JaTabs styling (basic). Value default is basic. <\\/li>\\n\\t\\t\\t<li><strong>width:<\\/strong><br \\/> Width of the tabs. It can be fixed or automatically. Example: empty or ''100%'' or ''600''<\\/li>\\n\\t\\t\\t<li><strong>height:<\\/strong><br \\/> Height of the tabs. It can be fixed or automatically. Example: empty or ''auto'' or ''400''.<\\/li>\\n\\t\\t\\t<li><strong>widthTabs:<\\/strong><br \\/> Width of the tabs. It should be ''empty'' for the ''Top\\/Bottom'' position of tabs title and fixed (like ''150'') for the ''Left\\/Right'' position of tabs title.<\\/li>\\n\\t\\t\\t<li><strong>heightTabs:<\\/strong><br \\/> Height of the tabs. It should be ''empty'' for ''Left\\/Right'' position of tabs title and fixed (like ''30'' for ''Top\\/Bottom'' position of tabs title.<\\/li>\\n\\t\\t\\t<li><strong>duration (ms):<\\/strong><br \\/> Time interval of the transition effect when autoplay is on in milliseconds. Value default is 1000. <\\/li>\\n\\t\\t\\t<li><strong>animType:<\\/strong><br \\/> (animFade, animMoveHor, animMoveVir, none). Define the transition effect for the autoplay. Value default is animMoveVir.<\\/li>\\n\\t\\t\\t<li><strong>mouseType:<\\/strong><br \\/> (click, mouseover, none). Action behavior of the control panel. Value default is click. <\\/li>\\n\\t\\t\\t<li><strong>skipAnim:<\\/strong> <br \\/> (true, false). Skip animation. Value default is false.<\\/li>\\n\\t\\t\\t<li><strong>ajax:<\\/strong> <br \\/> (true, false). Setting \\"true\\" if you want to use ajax to load content of tabs (Not apply for HTML Content type). Value default is false.<\\/li>\\n\\t\\t\\t<li><strong>view:<\\/strong> <br \\/> (introtext, fulltext). Apply for Articles.<\\/li>\\n\\t\\t\\t<li><strong>colors:<\\/strong> <br \\/> Input the class for each tab in format: 1:class1,2:class2. The supported class depend on the tab style.<\\/li>\\n\\t\\t\\t<li><strong>module:<\\/strong> <br \\/> Apply for type=\\"modules\\". Input module position which will display in tabs. For example: articleslatestload<\\/li>\\n\\t\\t\\t<li><strong>modulename:<\\/strong> <br \\/> Apply for type=\\"module\\". Input one or more module names which are separated by comma. For example: mod_articles_news, mod_articles_latest<\\/li>\\n\\t\\t\\t<li><strong>ids:<\\/strong> <br \\/> Apply for type=\\"articles\\". Input one or more article IDs which are separated by comma. For example: 1, 2, 3, 4<\\/li>\\n\\t\\t\\t<li><strong>catid:<\\/strong> <br \\/> Apply for type=\\"articles\\". Input one catergory from which you want to display their articles in tabs. For example: 1<\\/li>\\n\\t\\t\\t<li><strong>maxitems:<\\/strong> <br \\/> Maximum number of articles displaying<\\/li>\\n\\t\\t\\t<\\/div>\\t\\t\\t\\n\\t\\t\\t<p><span style=\\"color: #ff6600;\\"><strong>For Example tags:<\\/strong><\\/span><\\/p>\\n\\t\\t\\t<div  style=\\"font-weight: normal\\">\\n\\t\\t\\t<b>1. Type = modules<\\/b>\\t\\t\\n\\t\\t\\t<p>\\n\\t\\t\\t<code>{jatabs type=\\"modules\\" module=\\"position-7\\" position=\\"top\\" \\n\\t\\t\\t\\tmouseType=\\"click\\" animType=\\"animFade\\"}\\n\\t\\t\\t{\\/jatabs}<\\/code>\\n\\t\\t\\t<\\/p>\\t\\t\\t\\n\\t\\t\\t<b>2. Type = module<\\/b>\\t\\t\\n\\t\\t\\t<p>\\n\\t\\t\\t<code>{jatabs type=\\"module\\" modulename=\\"mod_menu, mod_login\\" \\n\\t\\t\\tposition=\\"left\\" widthTabs=\\"150\\" animType=\\"animMoveVir\\"}\\n\\t\\t\\t{\\/jatabs}<\\/code>\\n\\t\\t\\t<\\/p>\\t\\t\\n\\t\\t\\t<b>3. Type = content<\\/b>\\t\\t\\n\\t\\t\\t<p>\\n\\t\\t\\t<code>{jatabs  type=\\"content\\" position=\\"top\\" height=\\"240\\" mouseType=\\"mouseover\\" \\n\\t\\t\\t\\tanimType=\\"animMoveHor\\"}\\n\\t\\t\\t  [tab title=\\"Entertainment\\"]\\n\\t\\t\\t    &lt;img src=\\"images\\/sampledata\\/fruitshop\\/apple.jpg\\" \\n\\t\\t\\t    alt=\\"Sample image\\" align=\\"left\\" class=\\"caption\\" \\/&gt;...\\n\\t\\t\\t  [\\/tab]\\n\\t\\t\\t  [tab title=\\"Travel\\"]\\n\\t\\t\\t    &lt;img src=\\"images\\/sampledata\\/fruitshop\\/bananas_2.jpg\\" \\/&gt;\\n\\t\\t\\t  [\\/tab]\\n\\t\\t\\t  [tab title=\\"Artist\\"]\\n\\t\\t\\t    &lt;img src=\\"images\\/sampledata\\/fruitshop\\/tamarind.jpg\\" \\/&gt;\\n\\t\\t\\t  [\\/tab]\\n\\t\\t\\t{\\/jatabs}<\\/code>\\n\\t\\t\\t<\\/p>\\t\\t\\t\\n\\t\\t\\t<b>4. Type = articles<\\/b>\\t\\t\\n\\t\\t\\t<p>\\n\\t\\t\\t<code>{jatabs type=\\"articles\\" ids=\\"25, 26, 27\\" ajax=true view=\\"introtext\\" position=\\"right\\" \\n\\t\\t\\t\\twidthTabs=150 width=530 animType=\\"animMoveVir\\"}\\n\\t\\t\\t{\\/jatabs}<\\/code>\\n\\t\\t\\t<\\/p>\\t\\t\\n\\t\\t\\t<b>5. Type = articles<\\/b>\\t\\t\\n\\t\\t\\t<p>\\n\\t\\t\\t<code>{jatabs type=\\"articles\\" catid=\\"55\\" view=\\"introtext\\" ajax=true position=\\"bottom\\"\\n\\t\\t\\t\\tanimType=\\"animMoveHor\\"}\\n\\t\\t\\t{\\/jatabs}<\\/code>\\n\\t\\t\\t<\\/p>\\t\\t\\t\\n\\t\\t\\t<\\/div>\\n\\t\\t\\t<p><strong><span style=\\"color: #ff0000;\\">Upgrade Methods :<\\/span><br \\/><\\/strong><\\/p>\\n\\t\\t\\t<ol>\\n\\t\\t\\t\\t<li>Standard joomla uninstall \\/ reinstall method. OR<\\/li>\\n\\t\\t\\t\\t<li>Module supports upgrade method. You can install new version directly over this version. Uninstallation is not required. Backup any customized file before upgrading, your settings would be saved though. OR<\\/li>\\t\\t\\n\\t\\t\\t<\\/ol>\\n\\t\\t\\t<p><span style=\\"color: #008000;\\"><strong>Links :<\\/strong><\\/span><\\/p>\\t\\t\\t\\t\\t\\t\\n\\t\\t\\t\\t<a target=\\"_blank\\" href=\\"http:\\/\\/update.joomlart.com\\/#products.list\\/plugin_16\\/JA%20Tabs%20plugin%20for%20Joomla%201.7.x\\"\\/>Updates &amp; Versions<\\/a>\\t\\t\\t\\t\\n\\t\\t\\t<p>Copyright 2004 - 2011 <a href=\\"http:\\/\\/www.joomlart.com\\/\\" title=\\"Visit Joomlart.com!\\">JoomlArt.com<\\/a>.<\\/p> \\n\\t\\t\\t<style type=''text\\/css''>\\t\\n\\t\\t\\t.plg-desc li,\\n\\t\\t\\t.mod-desc li{\\n\\t\\t\\t\\tbackground: url(\\"..\\/plugins\\/system\\/jatabs\\/jatabs\\/arrow-level1.png\\") no-repeat left 12px;\\n\\t\\t\\t\\tmargin-left:10px;\\n\\t\\t\\t\\tpadding-left:12px;\\n\\t\\t\\t\\tline-height: 180%;\\n\\t\\t\\t}\\n\\t\\t\\t.plg-desc p,\\n\\t\\t\\t.mod-desc p{\\n\\t\\t\\t\\tmargin:15px 0;\\n\\t\\t\\t}\\n\\t\\t\\t<\\/style>\\n\\t\\t\\n\\t","group":""}', '{"disable_tab":"0","style":"nex","position":"top","width":"100%","height":"auto","widthTabs":"100%","heightTabs":"39","view":"introtext","jaclass":"","duration":"1000","animType":"animMoveVir","skipAnim":"false","mouseType":"click"}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
