(10088, 'JA Bulletin', 'module', 'mod_jabulletin', '', 0, 1, 0, 0, '{"legacy":false,"name":"JA Bulletin","type":"module","creationDate":"December 2011","author":"JoomlArt.com","copyright":"Copyright (C), J.O.O.M Solutions Co., Ltd. All Rights\\n\\t\\tReserved.","authorEmail":"webmaster@joomlart.com","authorUrl":"www.joomlart.com","version":"1.1.6","description":"\\n\\t\\n\\t   <span style=\\"color: #008000;\\">\\n\\t   \\t<strong>JA Bulletin Module<\\/strong>\\n\\t   <\\/span>\\n\\t   <br \\/>\\n\\t   <div style=''font-weight: normal''>\\n\\t   <p><img alt=\\"JA Bulletin Module\\" src=\\"http:\\/\\/static.joomlart.com\\/images\\/stories\\/extensions\\/joomla\\/ja_bulletin.png\\" \\/><\\/p>\\n\\t   This module behaves like default joomla most read and latest modules, but supports options to show date and thumbnail images.\\n\\t   \\n\\t   <p style=\\"clear:both\\"><span style=\\"color: #ff6600;\\"><strong>Features:<\\/strong><\\/span><\\/p>\\n\\t   <ol><li>Show \\/ hide Images in the list<\\/li><li>Show or hide Date of the article.<\\/li><li>Easy thumbnail generation, set your own dimensions.<\\/li><\\/ol>\\n\\t   \\n\\t   <p><strong><span style=\\"color: #ff0000;\\">Important Instructions:<\\/span><\\/strong><\\/p>\\n\\t   <ol><li>Keep your module updated with the latest version<\\/li><\\/ol>\\n\\t   <p><strong><span style=\\"color: #ff0000;\\">Upgrade Methods:<\\/span><br \\/><\\/strong><\\/p>\\n\\t   <ol>\\n\\t   \\t<li>Standard joomla reinstall method. OR<\\/li><li>Module supports upgrade method. You can install new version directly over this version. Uninstallation is not required. Backup any customized file before upgrading, your settings would be saved though. OR<\\/li>\\n\\t   \\t<li>Use <strong><a href=\\"http:\\/\\/extensions.joomla.org\\/extensions\\/core-enhancements\\/installers\\/12077\\" target=\\"_blank\\">JA Extensions Manager<\\/a><\\/strong> Component for easy upgrades and rollbacks. <strong><a href=\\"http:\\/\\/www.youtube.com\\/user\\/JoomlArt#p\\/c\\/BC9B0C0BFE98657E\\/2\\/mNAuJRmifG8\\" target=\\"_blank\\">Watch Video.<\\/a><\\/strong><\\/li>\\n\\t   <\\/ol>\\n\\t   <p><span style=\\"color: #008000;\\"><strong>Links:<\\/strong><\\/span><\\/p>\\n\\t   <ul><li><a target=\\"_blank\\" href=\\"http:\\/\\/www.joomlart.com\\/forums\\">JA Bulletin Module Forum<\\/a><\\/li><li><a target=\\"_blank\\" href=\\"http:\\/\\/pm.joomlart.com\\/browse\\/JAECMODBULLETINJIVI\\">Report Bug<\\/a><\\/li><li><a target=\\"_blank\\" href=\\"http:\\/\\/update.joomlart.com\\/#products.list\\/JA%20Bulletin%20module%20for%20Joomla%201.6\\/\\">Updates &amp; Versions<\\/a><\\/li><\\/ul>\\n\\t   <p>Copyright 2004 - 2010 <a href=\\"http:\\/\\/www.joomlart.com\\/\\" title=\\"Visit Joomlart.com!\\">JoomlArt.com<\\/a>.<\\/p>\\n\\t   <\\/div>\\n\\t\\n\\t","group":""}', '{"moduleclass_sfx":"","content_setting":"","type":"latest","ordering":"published","using_mode":"catids","category":"","k2catsid":"","count":"5","show_featured":"1","show_date":"1","show_author":"0","show_readmore":"0","show_hits":"0","use_custom_text":"1","custom_text":"Hits:","image_setting":"","show_image":"1","thumbnail_mode":"crop","use_ratio":"1","width":"40","height":"40","cache":"1","cache_time":"30"}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
(10089, 'Content - JA Thumbnail', 'plugin', 'plg_jathumbnail', 'content', 0, 1, 1, 0, '{"legacy":true,"name":"Content - JA Thumbnail","type":"plugin","creationDate":"Sept 2011","author":"JoomlArt.com","copyright":"J.O.O.M Solutions Co., Ltd.","authorEmail":"webmaster@joomlart.com","authorUrl":"www.joomlart.com","version":"1.1.1","description":"\\n\\t\\n\\t<h1>Introduce<\\/h1>\\n\\t<span style=''color: #008000;''>Content - JA Thumbnail<\\/strong><\\/span>\\n\\tThis plugin is used to generate Auto Thumbnail in Joomla Articles. This must be properly configured to make the best use out of it. Below are important note.\\n\\t<p><span style=''color: #ff6600;''><strong>Features:<\\/strong><\\/span><\\/p>\\n\\t<img border=''0'' alt=''JA Highslide plugin'' src=''http:\\/\\/asset.joomlart.com\\/images\\/stories\\/extensions\\/joomla\\/jaec_highslide.png?javer=1109130907'' style=''float: left''>\\n\\tThe Manual mode is recommended for site with less images, the Auto mode is for site with massive volumn of images\\n\\t<p><strong><span style=''color: #ff0000;''>Important Instructions :<\\/span><\\/strong><\\/p>\\n\\tNote: Allow off some specified images for an article <code>{jathumbnail off images=\\"images\\/stories\\/demo\\/world\\/rs-3.jpg,images\\/stories\\/demo\\/world\\/rs-2.jpg\\"}<\\/code>\\n\\t<p><strong><span style=''color: #ff0000;''>Usage Instructions :<\\/span><br \\/><\\/strong><\\/p>\\n\\tIn the <strong>\\"Integration Mode\\"<\\/strong>  on the parameter list on the right: <br \\/>\\n\\t\\t<ul>\\n\\t\\t\\t<li>\\"<strong>Auto<\\/strong>\\" mode: All joomla article will have this feature enable. To turn off plugin for specific article, use the <font color=\\"red\\"><strong><em>{jathumbnail off}<\\/em><\\/strong><\\/font> in that article.<\\/li>   \\n\\t\\t\\t<li>\\"<strong>Manual<\\/strong>\\" mode: You must you [jathumbnail] somewhere in the joomla content to enable this plugin for that article. <\\/li>   \\n\\t\\t\\t<li> \\"<strong>Disable<\\/strong>\\" mode: Disable the Thumbnail generation (DO NOT use the Disable feature of Joomla if you have used the tag <em><strong>{jathumbnail}<\\/strong><\\/em> or <em><strong>{jathumbnail off}<\\/strong><\\/em> already. It will be parsed as normal text.<\\/li> \\n\\t\\t<\\/ul>\\n\\t<p><strong><span style=''color: #ff0000;''>Upgrade Methods :<\\/span><br \\/><\\/strong><\\/p>\\n\\t\\t<ol><li>Standard joomla uninstall \\/ reinstall method. Module supports upgrade method. <\\/li>\\n\\t\\t<li>You can install new version directly over this version. Uninstallation is not required. <\\/li>\\n\\t\\t<li>Backup any customized file before upgrading, your settings would be saved though.<\\/li><\\/ol>\\n\\t<p><span style=''color: #008000;''><strong>Links :<\\/strong><\\/span><\\/p>\\n\\t<ul><li><a target=''_blank'' href=''http:\\/\\/update.joomlart.com\\/#products.list\\/plugin_16\\/JA%20Thumbnail%20plugin%20for%20Joomla%201.7.x\\/''>Updates &amp; Versions<\\/a><\\/li><\\/ul>\\n\\t<p>Copyright 2004 - 2011 <a href=''http:\\/\\/www.joomlart.com\\/'' title=''Visit Joomlart.com!''>JoomlArt.com<\\/a>.<\\/p>\\n\\t\\n\\t","group":""}', '{"content_mode":"auto","content_mode-auto-content_position":"1","content_mode-auto-manual-content_width":"210","content_mode-auto-manual-content_height":"120","content_mode-auto-manual-crop_image":"1","content_mode-auto-manual-content_align":"left","view_on_page":"all","blog_mode-1-apply_catetories":["90","88","87","86","85","84","83","82","81"],"blog_mode-1-blog_leading_width":"210","blog_mode-1-blog_leading_height":"120","blog_mode-1-blog_intro_width":"210","blog_mode-1-blog_intro_height":"120","blog_mode-1-crop_image":"1"}', '', '', 0, '0000-00-00 00:00:00', 0, 0),
