INSERT INTO `#__kunena_messages_text` (`mesid`, `message`) VALUES
(1, '[size=4][b]Welcome to Kunena![/b][/size] \n\n Thank you for choosing Kunena for your community forum needs in Joomla. \n\n Kunena, translated from Swahili meaning &ldquo;to speak,&rdquo; is built by a team of open source professionals with the goal of providing a top quality, tightly unified forum solution for Joomla. Kunena even supports social networking components like Community Builder and JomSocial. \n\n\n [size=4][b]Additional Kunena Resources[/b][/size] \n\n [b]Kunena Documentation:[/b] [url]http://www.kunena.org/docs[/url] \n\n [b]Kunena Support Forum[/b]: [url]http://www.kunena.org/forum[/url] \n\n [b]Kunena Downloads:[/b] [url]http://www.kunena.org/downloads[/url] \n\n [b]Kunena Blog:[/b] [url]http://www.kunena.org/blog[/url] \n\n [b]Submit your feature ideas:[/b] [url]http://www.kunena.org/uservoice[/url] \n\n [b]Follow Kunena on Twitter:[/b] [url]http://www.kunena.org/twitter[/url]'),
(2, 'NOT everybody yearns for Brooklyn, or even for what Brooklyn has come to represent among New York restaurants. The guys in beards and knit hats have their place, as do the tattooed servers, the avant-garde wines and turn-of-the-last-century cocktailians, and all the rest.'),
(3, 'EDUCATING the average drinker on the qualities of firewater, and how to best enjoy it, has been one of the central credos of the new generation of mixologists. “Knowledge!” they cry, as they throw back shots of Fernet-Branca. \r\n\r\nBut some booze-addled misconceptions continue to cling to the lizard brain of the American tippler. An army of bartenders can protest that a wetter martini is both more delectable and historically accurate, but certain committed fanciers of the cocktail, channeling their inner Gray Flannel Suit, will still maintain the drink attains perfection only at its driest, when vermouth is banished from the barroom.\r\n\r\nSuch antiquated contentions are like “nails on a chalkboard,” said Eric Alperin, an owner of the Varnish in Los Angeles. “I think the reason people stand by those myths is because it is a sound bite they’ve acquired, and a bar is a place to feel confident with yourself and exude a little know-how.”\r\n\r\nMany reinforce a drinker’s virility, particularly with regard to the most manly of spirits — whiskey.\r\n\r\nSome of those idées fixes:\r\n\r\nOLDER IS BETTER “It’s absolute nonsense,” said Ronnie Cox, director of the Glenrothes, a Speyside Scotch. “It’s not about oldness, it’s about maturity. Age doesn’t mean anything other than that whiskey’s been in that cask for that amount of time.” Making whiskey requires finding the right balance among myriad elements. A few whiskeys prosper with advanced age, but many fall off a cliff into sensory disharmony at a certain point. Rittenhouse Rye 100, from Kentucky, takes only four years to reach the chewy, spicy sweet spot bartenders swear by. But the Old Pulteney 21-year-old Scotch probably needed to attain drinking age to hit its briny perfection.'),
(4, 'IN my pre-motherhood years, I approached the holidays like some butter-crazed elf, creating a sugary mountain of dainty morsels. I’d tint royal icing in a dozen hues, dredge up the dragées, pipe out decorations. \r\n\r\nI served platters of colorful, glittering cookies at the end of many a holiday party.\r\n\r\nAnd I handed them out as Christmas gifts to everyone who crossed my path during the month of December — all random delivery men included.\r\n\r\nThese days, with a small child in the house, two or three kinds of cookies are all I have time for.\r\n\r\nSo I choose them carefully, selecting one easy family favorite that I can decorate (usually gingerbread), one crowd pleaser that I can make quickly in bulk (large pans of brownies or shortbread fill the bill), and one wild card that I’ve never made before to appease my yen for experimentation.\r\n\r\nThis year, my wild card is linzer cookies — with a twist.\r\n\r\nI’ve happily baked the classic nut-studded, highly spiced, jam-filled cookies many times before. But all that cinnamon in the mix makes them seem too similar to the gingerbread I was also planning to bake.\r\n\r\nInstead I wanted to come up with a recipe that preserves the nutty, jammy essence of the cookie but alters the flavor profile.\r\n\r\nMy first change was to replace the usual hazelnuts or almonds with pistachio nuts. Not only do they dot the cookies with pretty green flecks, but I also love their gentle sweetness and freshness.\r\n\r\nThen I added orange-blossom water to accentuate the brightness of the pistachios. And, instead of raspberry jam, I sandwiched orange marmalade between the rounds to bring out the orange-blossom water.\r\n\r\nThis sandwiching is best done right before serving the cookies, or maybe up to a day ahead. Any more than that and the cookies soften and start to fall apart as they absorb the moisture from the jam.\r\n\r\nAll in all, my linzer cookies were much tangier and a bit less sweet than the traditional ones, but just as buttery, rich and compelling. They will also contrast nicely with the gingerbread and the brownies on my cookie platter — which is much more modest than it’s been in the past. But just as much fun.'),
(5, 'FIRST, winemakers poured their vintages into bottles and corked them. Then they lost the corks and added screw tops. Then they lost the bottles and sold wine in boxes, next to beer and pretzels at supermarkets. And now, winemakers seeking some pop are canning wine.'),
(6, ':P \r\n\r\nDolor congue vitae nibh ac lacinia mi metus quis fames et. Id porttitor augue magna ac Donec risus ligula quis morbi Cum.'),
(7, '[quote="admin" post=4]IN my pre-motherhood years, I approached the holidays like some butter-crazed elf, creating a sugary mountain of dainty morsels. I’d tint royal icing in a dozen hues, dredge up the dragées, pipe out decorations. \r\n\r\nI served platters of colorful, glittering cookies at the end of many a holiday party.\r\n\r\nAnd I handed them out as Christmas gifts to everyone who crossed my path during the month of December — all random delivery men included.\r\n\r\nThese days, with a small child in the house, two or three kinds of cookies are all I have time for.\r\n\r\nSo I choose them carefully, selecting one easy family favorite that I can decorate (usually gingerbread), one crowd pleaser that I can make quickly in bulk (large pans of brownies or shortbread fill the bill), and one wild card that I’ve never made before to appease my yen for experimentation.\r\n\r\nThis year, my wild card is linzer cookies — with a twist.\r\n\r\nI’ve happily baked the classic nut-studded, highly spiced, jam-filled cookies many times before. But all that cinnamon in the mix makes them seem too similar to the gingerbread I was also planning to bake.\r\n\r\nInstead I wanted to come up with a recipe that preserves the nutty, jammy essence of the cookie but alters the flavor profile.\r\n\r\nMy first change was to replace the usual hazelnuts or almonds with pistachio nuts. Not only do they dot the cookies with pretty green flecks, but I also love their gentle sweetness and freshness.\r\n\r\nThen I added orange-blossom water to accentuate the brightness of the pistachios. And, instead of raspberry jam, I sandwiched orange marmalade between the rounds to bring out the orange-blossom water.\r\n\r\nThis sandwiching is best done right before serving the cookies, or maybe up to a day ahead. Any more than that and the cookies soften and start to fall apart as they absorb the moisture from the jam.\r\n\r\nAll in all, my linzer cookies were much tangier and a bit less sweet than the traditional ones, but just as buttery, rich and compelling. They will also contrast nicely with the gingerbread and the brownies on my cookie platter — which is much more modest than it’s been in the past. But just as much fun.[/quote]\r\n\r\nOrci augue faucibus gravida nisl penatibus Nulla volutpat libero eros tortor. Vivamus sapien lacus porttitor Vestibulum Donec congue et sed quis ridiculus. Dictum id Quisque hac tellus mi Curabitur nec platea cursus lobortis. Donec lacinia pretium dui Aenean molestie condimentum odio montes tellus est. Orci quis Nam sagittis Lorem vitae tortor Aenean tellus gravida suscipit. Tempor tellus Ut velit amet.\r\n\r\nEget urna cursus dictumst dui Phasellus urna Sed enim nonummy lobortis. Et ligula id mauris fringilla Nam faucibus quam pede auctor consequat. Magnis orci pellentesque auctor non metus a justo elit Lorem adipiscing. Metus sit ac Nam dictum mauris vitae auctor id non Vestibulum. Orci Sed Ut augue ut Curabitur aliquam Donec elit nec ipsum. Venenatis convallis condimentum Mauris Curabitur tincidunt fermentum aliquam at laoreet.');
